webpackJsonp([0xd0097b6fe87f],{5516:function(t,e){t.exports={data:{post:{html:'<p>The CeBIT starts today in not-too-distant Hannover. I\'m glad not to be there. Meanwhile, Mama flies to Frankfurt for an impromptu afternoon meeting. Impromptu far-away meetings are never good.</p>\n<p>Lots of people are saying how they are downloading Mozilla 0.9.9, but since my <a href="http://www.debian.org">system</a> has <a href="http://www.oreilly.com/catalog/debian/chapter/appc_05.html">apt-get</a>, I don\'t have to. My nightly apt-get cron job will do it for me. Heh.</p>\n<p>"The (US) INS is the Mickey Mouse Club of federal agencies, but this... is an insult to Mickey Mouse." Mama always suspected this (it took them 4 tries to issue her a Green Card with her name spelled correctly), but now we know it\'s <a href="http://www.washingtonpost.com/wp-dyn/articles/A16787-2002Mar12.html">true</a>.</p>',fields:{title:"First Steps",date:"13 Mar 2002",url:"https://papascott.de/2002-03-13-first-steps/"}}},pathContext:{slug:"/2002-03-13-first-steps/",prev:{fields:{title:"Towers of Light",date:"12 Mar 2002",slug:"/2002-03-12-towers-of-light/"}},next:{fields:{title:"Christopher Crisis",date:"14 Mar 2002",slug:"/2002-03-14-christopher-crisis/"}}}}}});
